import React from "react";

const Projectmenu = ({ filterItem, menuList }) => {
  return (
    <>
      {menuList.map((curElem) => {
        return <div className="filtermenu"><button className="btn-group__item" onClick={() => filterItem(curElem)}> {curElem} </button></div>
      })}
    </>
  );
};

export default Projectmenu
